<script>
function printLowReturnHigh(arr){
  let min = arr[0],
      max = arr[0];

  for(let i = 1; i < arr.length; i++){
    if(arr[i] > max){
      max = arr[i];
    }
    if(arr[i] < min){
      min = arr[i];
    }
  }
  console.log(min);
  return max;
}
let myArr = [2,-8,-9,10,-2,-8,11,2,9];

console.log(printLowReturnHigh(myArr));

</script>
